import React, { Component } from "react";
import PropTypes from "prop-types";
import { Card, TextField, withStyles } from "@material-ui/core";

const styles = theme => ({
    card: {
        height: 700,
        width: '50%',
        marginTop: '7%',
        marginLeft: '25%',
        border: '1px solid black'
    },
});

class CardComponent extends Component {
    render() {
        const { classes, imageUrl, title, caption, text, actionLink } = this.props;
        return (
            <Card className={classes.card}>
                <TextField label="Standard" floatingLabelText="First Name" />
                <br/>
                <TextField hintText="Enter your First Name" floatingLabelText="First Name" />
                <br/>
                <TextField hintText="Enter your First Name" floatingLabelText="First Name" />
                <br/>
                <TextField hintText="Enter your First Name" floatingLabelText="First Name" />
                <br/>
                <TextField hintText="Enter your First Name" floatingLabelText="First Name" />
                <br/>
                <TextField hintText="Enter your First Name" floatingLabelText="First Name" />
                <br/>
                <TextField hintText="Enter your First Name" floatingLabelText="First Name" />
                <br/>
                <TextField hintText="Enter your First Name" floatingLabelText="First Name" />
                <br/>
                <TextField hintText="Enter your First Name" floatingLabelText="First Name" />
            </Card>
        );
    }
}

CardComponent.propTypes = {
    classes: PropTypes.object.isRequired
};

export default withStyles(styles)(CardComponent);
